import {useState} from "react"

export default function LocationDropdown(props){
    const [allDropdownElements, setAllDropdownElements] =  useState([])
    props.listOfLoc.map(() =>{
        setAllDropdownElements(<p>{props.listOfLoc[0]}</p>)
    })

    return(
        <div className="location-dropdown-element">
            {allDropdownElements}
        </div>
    )
}
